(15, 'Team Darshan', 'Its a great feeling for us to launch this website. We are trying to give a medium to Belgaumities through which they can watch Ganeshostav - 2014  online using electronic media. we are \nnot just focusing on Belgaum city but even the outskirts of Belgaum. We invite all of you to participate with us in this fest by sending best clicks of your Ganeshostav which will be uploaded on the website with your name. Lets have a peaceful and happy Ganesh Festival. \nHappy Ganesh Chaturthi. ', '1', '2014-08-28 04:16:02'),
