(39, 'VIJAY MORE EX MAYOR', 'Its my sincere wish that Ganesh idols should be viewed all over India and I am very pleased that Darshanbelgaum has taken the initiative to do the same.I would like to give credit to darshan team for spreading the message that after Mumbai and Pune Ganesh Chaturthi is celebrated in Belgaum on a very grand scale. I the Ex. Mayor of Belgaum would like to thank everyone for their contribution. Lokmanya Bal Gangadar Tilak started the first Ganesh Chaturthi celebration in Pune with the intention of bringing people together and hence this website will be a platform for all Ganesh devotees to follow the footprints of this great legend.', '1', '2014-08-29 21:06:56'),
