(76, 'Vijay Patil[ VISHAL INFRABUILD LTD ]', 'Congratulations to Shrikant Desai and Team Darshan. In our culture any good thing begins with Ganesh Pujan.The initiative taken by Darshan Team in the form of Darshanbelgaum website is really appreciable. People who stays overseas can view the Ganesh idols and get to know more information about Lord Ganesh and create a bond with our culture.I like the idea of bringing all Ganesh mandals together and making a common Ganeshotsav which was originally thought by Lokmanya Bal Gangadar Tilak to celebrate Ganesh Chaturthi on a large scale.', '1', '2014-09-06 02:28:14'),
