(160, 'venktesh sarnobat (vice president of Belgaum Chember Of Commerce and Industries)', 'Firstly i congratulate Darshan Team who are part of our SGU Mandal. I whole heartedly support the views of MD Shrikant Desai to bring all the Ganapatis together on one single platform. I personally know the struggle I took to generate finance and built the team of our Tilkawadi Cha Raja. We must develop our festivals on a grand scale by coming together I wish the dream come true you all the best.', '1', '2014-09-08 01:21:00'),
