(175, 'bhatkande vikram', 'Its good ........ Nice work\n', '1', '2014-09-10 03:48:47'),
(176, 'Kedar Patil', 'Appreciate the vision for creating such a site. nice website', '1', '2014-09-11 03:45:10'),
(177, 'snehal herekar', 'Congratulations darshan team Good Website Now i can watch belgaum ganapatis from any corner of the world . Thanku darshan team for making me to feel as i am present in belgaum', '1', '2014-09-11 05:54:35'),
(178, 'Ramdas Dhakane', 'Ganpati bappa morya', '1', '2014-09-11 06:17:25'),
(179, 'sajan', 'Nice drawing. ..ganptii  bappppaa  moarya. .....', '1', '2014-09-11 06:48:30'),
(180, 'sajan', 'Nice drawing. ..ganptii  bappppaa  moarya. .....', '1', '2014-09-11 06:48:46'),
(181, 'snehal herekar', 'Really appreciate the thought of merging many mandals into one .\n', '1', '2014-09-11 06:52:30'),
(183, 'Aniket Deshpande', 'Awesome work hope to see this continue for many years', '1', '2014-09-11 08:52:04'),
(184, 'kadambari sureshkumar', 'Thank u so much sir happy ganesh chaturathi..', '1', '2014-09-11 10:32:34'),
(185, 'sunil', 'Ganpati bappa moray.Congratulations darshan team Good Website Now i can watch belgaum ganapatis from any corner of the world . Really appreciate the thought of merging many mandals into one it would wonderful..DADA & Darshan Team for the Excellent Job Keep up the good work.', '1', '2014-09-11 12:43:33'),
(186, 'Dipit Desai', 'darshanbelgaum.com is a wonderful way to reach Ganesh Darshan.. " HAPPY GANESH CHATURTHI" Keep up the good work.', '1', '2014-09-11 12:45:27'),
(187, 'Rajendra Bansur (Vishal Infrabuild Ltd.)', 'Lokmanya Balgangadhar Tilak started this ganesh Utsav on a public scale to bring the society/people together. Keeping the same thing in mind Shri Shrikant Desai Sir(Dada) has launched Darshan Belgaum site, with the vision to bring Belgaum people together. Congratulation to Shrikant Sir & Team Darshan.', '1', '2014-09-11 21:37:56'),
(188, 'Rohit Chavan', 'Good idea and a good way to help all Ganapati devotees out of Belgaum. Great work God bless you and YES the idea to have a few mandals is great', '1', '2014-09-11 23:30:49'),
(189, 'Kamal ', 'Your idea ROCKS ....First time in my life I was able to watch so many Ganapatis,  I left Belgaum long time ago but your website brings me closer to Ganesh and Belgaum ... keep it up', '1', '2014-09-11 23:34:51'),
(190, 'Rohit Chavan', 'Great site and good initiative - God will help you to reach the goal. Keep trying', '1', '2014-09-11 23:36:08'),
(191, 'Prabhanjan Jadhav', 'Congrats Darshan team and specially DADA. Net site is user friendly, very good collection of city and out side. There is scope for improvement in picture quality. All the best to entire team for future work.   ', '1', '2014-09-12 03:01:21'),
(192, 'Nitin @ Gurudatt N Pai', 'Hearty congratulations to Dada @ Srikant Desai and darshan belgaum team for the launch of their website. It is a proud feeling to know that the talent of belgaum is reaching new scales. Had the opportunity to work with this team for supporting the creation of www.tilakwadicharaja.com. Belgaum has its own customs  & culture of celebrating Ganesh chaturthi which the world will surely be able to glimpse through this website. An innovative concept that will also help our elders to sit at home and enjoy visits to all the mandals of belgaum.\nWishing the team all the success and may Lord ganesh help you to soar greater heights.', '1', '2014-09-13 04:45:32'),
(193, 'Someone ........', '.........you are passionate in what u do, be it education Edupro, be it football, be it Ganesh on web, you are a solid fellow Srikant. Kids remember ur talk at JITO Belgaum... Remember u got a lot of folks who support n follow u. keep it up', '1', '2014-09-13 18:06:22'),
(194, 'Apurva & Chetan bhati', 'Your site is beautiful, collection is wonderful. It will be helpful to take ganesh darshan sitting at home and abroad. Congrats darshan team. ', '1', '2014-09-13 20:24:00'),
(195, 'Vinayak V Bongale  [ Vishal infrabuild ltd Belgaum ]', 'I heartily congratulate Shri Shrikant Desai and Darshan Team for launching Darshan Belgaum to view \nall Ganesh Idols of Belgaum. Thanks to this website people can view all the Home Ganesh Idols and Sarvajanik Ganesh Idols at their place. Friends and Relatives staying abroad can also now watch the Ganesh Idols of Belgaum through this website. As the Idea of Lokmanya Tilak bringing all people together through Ganesh Chaturthi Celebration was very commendable similarly the idea of Darshan Team coming up with this website is also very commendable. Using this website as a platform people can post their suggestions as comments to improve the Ganesh Chaturthi Celebrations. <br />\nNow a days people make use of Dolby Systems to play Music during Ganesh Chaturthi. But due to the usage of Dolby System Noise pollutions is increasing. So my sincere appeal to the people is that they make use of Traditional instruments like Zanj Pathak, Dhol Tasha and reduce the usage of Dolby System. In this way festive spirit will remain intact and noise pollution will be reduced.\n', '1', '2014-09-15 22:19:39'),
(196, 'Vishwa Paramashetti', 'Great initiative..  Thanks for sharing all the pics with everyone. Keep up the good work.. ', '1', '2014-09-20 02:16:47'),
(197, 'Vasant', 'this Ganesh project is good , please put more power on football. U can do a better job and give scope to all players in belgaum', '1', '2014-09-20 19:43:54'),
(198, 'SP', 'All events and projects u do are good this Darshan Belgaum Ganesh work is a super hit. U must plan some good event for Belgaum women .   ', '1', '2014-09-20 19:50:56'),
(199, 'Yashashri Vankudre', 'All events are good & darshan belgaum website is superb as well as informative.', '1', '2014-11-08 21:23:05');
